import React from "react";
import {firebase} from "../../base";
import "./Room.css";
const Rooms = () => {

    var user = firebase.auth().currentUser;
    
    return (
        <>
            <div className="className">
                <h3>{user.displayName}</h3>
                <img src={user.photoURL} alt="Waiting....." />
            </div>
            
        </>
    )
}

export default Rooms
